import React, { Component } from 'react';

class Api extends Component {
  constructor() {
    super();
    this.state = {
      users: [],
    };
  }

  componentDidMount() {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then((response) => response.json())
      .then((usersList) => {
        this.setState({ users: usersList });
      });
  }
  FetchUsers = () => {
    fetch('https://jsonplaceholder.typicode.com/users')
      .then((response) => response.json())
      .then((usersList) => {
        this.setState({ users: usersList });
      });
  };

  render() {
    console.log(this.state.users.map((x) => x.name));
    return <div>deva</div>;
  }
}

export default Api;
